        "channelId": "UCOwSCdQi9YRIVq6H2iX3qWg",
        "title": "Eddie Van Halen Tribute: Top 5 Songs of Both Eras Feat. Sammy Hagar | Pop Fix | Professor of Rock",
        "description": "We lost one of the most influential and innovative guitarist of the Rock Era, when Eddie Van Halen succumbed to his long battle with throat cancer.   He was only 65 years old.  the word Legend is thrown around too much in the world we live in now. The over use of the term waters down the meaning for true legends and make no mistake the word legend was coined for EVH. Here at Professor of Rock, we want to honor to the Legend Eddie Van Halen through the music.   Not only was Eddie one of the all-time greatest guitarists, he was also a master composer, lyricist, producer, and multi-instrumentalist. He was a lightning fast player, a relentless originator, and a veritable trailblazer.  Here we break down Eddie‚Äôs top 5 song from both David Lee Roth era and the Sammy Hagar era including Runnin‚Äô with the Devil, Dreams, 5150, Panama, Best of Both Worlds, Mean Streets, I‚Äôm the One, Jump, When It‚Äôs Love, Poundcake and more with commentary by Sammy Hagar. \n\nThank you to this Episodes Sponsor, Zenni Optical\nIncredible Prices on New Glasses - https://bit.ly/ZenniOpticalShop\n-----------------------------------------------------------------------------------------------------------------------------\n\nProfessor's Store\nCheck out my Hand Picked Selection Below\n- Eddie Van Halen T Shirt https://amzn.to/2FiqATI\n- Must Have Van Halen Vinyl https://amzn.to/2IhC62W\n- 100 Best Selling Albums https://amzn.to/3h3qZX9\n- Ultimate History of 80s Teen Movie https://amzn.to/3ifjdKQ\n- 80s to 90s VHS Video Cover Art https://amzn.to/2QXzmIX\n- Totally Awesome 80s A Lexicon https://amzn.to/3h4ilrk\n- Best In Ear Headphones (I Use These Every Day) https://amzn.to/2ZcTlIl\n\n-----------------------------------------------------------------------------------------------------------------------------\n\nHonorary Producers\nGreg Arends, Howard Herrick\n-----------------------------------------------------------------------------------------------------------------------------\n\nCheck Out The Professor of Rock Merch Store - http://bit.ly/ProfessorMerch\n\nAccess To Backstage Content\nBecome a Patron - http://bit.ly/ProfessorofRockVIPFan\n\nHelp out the Channel by purchasing your albums through our links! As an Amazon Associate, I earn from qualifying purchases at no extra cost to you, thank you for your support.\n\nClick here for Premium Content: https://bit.ly/SignUpForPremiumContent\n\n https://bit.ly/Facebook_Professor_of_Rock\n\nhttps://bit.ly/Instagram_Professor_of_Rock\n\n#80s #Rock #Vinyl\n\nWe lost one of the most influential and innovative guitarist of the Rock Era, when Eddie Van Halen succumbed to his long battle with throat cancer.   He was only 65 years old.  the word Legend is thrown around too much in the world we live in now. The over use of the term waters down the meaning for true legends and make no mistake the word legend was coined for EVH. Here at Professor of Rock, we want to honor to the Legend Eddie Van Halen through the music.   Not only was Eddie one of the all-time greatest guitarists, he was also a master composer, lyricist, producer, and multi-instrumentalist. \n\nEddie was a lightning fast player, a relentless originator, and a veritable trailblazer.In the words of revered artists Frank Zappa and Jeff Beck, Eddie Van Halen ‚Äúre-invented guitar playing.‚Äù\nEddie was constantly experimenting for new sounds that matched the sounds that were ringing in his head\n\nHe didn‚Äôt care for the factory made guitars‚Ä¶he preferred to customize his axes to find something fresh and exciting.  To Eddie, perfection was ‚Äúboring,‚Äù and believed that ‚Äúmistakes were the most exciting element‚Äù of making music. Let‚Äôs pause a moment to ponder on that.  Because it‚Äôs one of the most important teachings that Eddie Van Halen has left us.  Perfection is boring, mistakes were the most exciting elements of making music. In a world of brain dead, fast food, auto tuned, cookie cutter, sample driven music, Eddie‚Äôs philosophy reigns over us like a spirit in the night.    I pray that we all truly contemplate his wisdom . \n\nThere are many Van Halen innovations, that made Eddie a legend, such as his use of the two-handed finger tapping. How he incorporated natural harmonics and volume swells, and produced that distinctive tone that budding guitarists have tried to emulate for more than 40 years. \n\nEddie Van Halen was one of the best rhythm guitarists- in an elite class with the likes of Hendrix, Clapton, and Page.    Along with brother Alex, David Lee Roth, and Michael Anthony, Eddie formed Van Halen in 1972, out of Pasadena, California.",
